import { GetDataChannel } from "../../../../src/services/youtube/connector"

export default async (req, res) => {
  const {
      query : { channel },
  } = req;
  const response = await GetDataChannel(channel)
  console.log(response);      
  res.statusCode = 200
  res.setHeader('Content-Type', 'application/json')
  res.json(response);
}
